import React, { Component } from 'react'
import { Link} from 'react-router-dom'

function Nav() {


  renderNavLinks = () => {
    if(localStorage.token !== "undefined" || localStorage.length > 0 ){
      return  <>
              <Link to="/">Home</Link>
              <Link to="/profile">Profile</Link>
              </>
    }  else {
      return <>
             <Link to="/">Home</Link>
             <Link to="/login">Login</Link>
             </>
          }
  }


  return(

   <nav>
     {this.renderNavLinks()}
   </nav>

    )
   }




export default Nav
